import { Searchbar, useForm } from 'react-native-paper';

export default function SearchBar() {
  const { inputs, handleChange } = useForm({
    input: '',
  });

  return (
    <Searchbar
      placeholder="Search"
      onChangeText={handleChange}
      value={inputs}
    />
  );
}
